"Kad Wi-Fi ir iespējots, pulkstenis automātiski ieslēgs vai izslēgs savienojumu ar Wi-Fi, lai taupītu akumulatora jaudu. Funkcija tiek aktivizēta šādos gadījumos: 

• kādai lietotnei nepieciešams savienojums ar Wi-Fi; 
• ir ieslēgts akumulatora jaudas taupīšanas režīms; 
• notiek pulksteņa uzlāde; 
• notiek pulksteņa atjaunināšana; 
• pulkstenis neatrodas tālruņa tuvumā; 
• pulkstenis nevar izveidot savienojumu ar Wi-Fi; 
• citās situācijās."
